Using the monadic dynamic semantics, we can modularly prove for each individual translation function that evaluating its output is equivalent to directly evaluating the input, modulo some lifting and adjustment of resulting values. After induction on the statement, the proofs are mostly concerned with case splitting, application of congruence theorems, and simplification. We can mostly offload these tasks onto Aesop . attribute [local simp] map_eq_pure_bind: ∀ {m : Type u_1 → Type u_2} {α β : Type u_1} [inst : Monad m] [inst_1 : LawfulMonad m] (f : α → β) (x : m α), f &lt;$&gt; x = do let a ← x pure (f a)map_eq_pure_bind ExceptT.run_bind: ∀ {m : Type u_1 → Type u_2} {ε α β : Type u_1} {f : α → ExceptT ε m β} [inst : Monad m] (x : ExceptT ε m α), ExceptT.run (x &gt;&gt;= f) = do let x ← ExceptT.run x match x with | Except.ok x =&gt; ExceptT.run (f x) | Except.error e =&gt; pure (Except.error e)ExceptT.run_bind
